import React, { useEffect, Fragment } from "react";
import AOS from "aos";
import $ from "jquery";
import Header from "./components/Header";
import Home from "./components/Home";
import Contact from "./components/Contact";
import Professionnel from "./components/Professionnel";
import SubHeader from "./components/SubHeader";
import Patients from "./components/Patient/Patients"
import Accueil from "./components/Patient/Acceuil"
import Documents from "./components/Patient/Documents"
import AvantExamen from "./components/Patient/AvantExamen"
import Resultat from "./components/Patient/Resultat"
import Urgences from "./components/Patient/Urgences"


import "aos/dist/aos.css";
import "./assets/styles/main.scss";
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'

const App = () => {
  useEffect(() => {
    AOS.init({ once: true });
    let navElement = $("nav");
    $(function() {
      $(window).scrollTop() > navElement.innerHeight()
        ? navElement.addClass("sticky")
        : navElement.removeClass("sticky");
    });
    $(window).on("scroll", function() {
      $(window).scrollTop() > navElement.innerHeight()
        ? navElement.addClass("sticky")
        : navElement.removeClass("sticky");
    });
  });

  return (
    <Router>
    <Fragment>
     <SubHeader/>
     <Header/>
     <main>
            <Route exact path="/" component={Home}/>
        <Switch>
            <Route path="/professionnel" component={Professionnel}/>
            <Route path="/patient" component={Patients}/>
            <Route path="/AccueilLabo" component={Accueil}/> 
            <Route path="/Documents" component={Documents}/>
            <Route path="/AvantExamen" component={AvantExamen}/>
            <Route path="/Resultat" component={Resultat}/>
            <Route path="/Urgences" component={Urgences}/>
        </Switch>
      </main>
      <Contact/>
    </Fragment>
    </Router>
  );
};

export default App;
